INSERT INTO `frontpages` (`id`, `track_name`, `title`, `description`) VALUES
(1, 'schoolHistory', 'বিদ্যালয়ের ইতিহাস', '<p>আনন্দ নগর আদর্শ উচ্চ বিদ্যালয়ের বিস্তারিত তথ্য সম্বলিত একটি ওয়েবসাইটের সুচনা নিঃসন্দেহে একটি গুরুত্বপূর্ণ মাইল</p>\r\n<p>&nbsp;</p>\r\n<p>ফলক হিসেবে বিবেচিত। প্রতিষ্ঠানের সম্পদ, জনবল কাঠামো ভর্তিসহ বিভিন্ন পরীক্ষা, রুটিন, ছুটি ও বার্ষিক অনুষ্ঠান সুচীসহ বিভিন্ন গুরুতবপূর্ন তথ্য এই ওয়েবসাইট এ সন্নিবেশিত থাকবে। আশাকরি ভবিষ্যতে এ ওয়েবসাইট টিকে সুষ্ঠুভাবে রক্ষানাবেক্ষন করা হবে এবং এর মাধ্যমে ঢাকা শিক্ষা বোর্ড সহ আগ্রহী সংশ্লিষ্ট সবাই প্রয়োজনীয় তথ্যাদি অবহিত হতে সক্ষম হবেন।</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 10px; color: #666666; font-family: Helvetica, Arial, sans-serif; font-size: 13px;">@@</p>\r\n<p>&nbsp;</p>'),
(2, 'headmasterMsg', 'প্রধান শিক্ষকের বাণী', '<p><img src="assets/otherFiles/HeadMaster183.jpg" alt="HeadMaster" width="200" height="200" /></p>\r\n<p>আনন্দ নগর আদর্শ উচ্চ বিদ্যালয়ের বিস্তারিত তথ্য সম্বলিত একটি ওয়েবসাইটের সুচনা নিঃসন্দেহে একটি গুরুত্বপূর্ণ মাইল</p>\r\n<p><span style="color: #666666; font-family: Helvetica, Arial, sans-serif; font-size: 13px;">@@</span></p>\r\n<p>ফলক হিসেবে বিবেচিত। প্রতিষ্ঠানের সম্পদ, জনবল কাঠামো ভর্তিসহ বিভিন্ন পরীক্ষা, রুটিন, ছুটি ও বার্ষিক অনুষ্ঠান সুচীসহ বিভিন্ন গুরুতবপূর্ন তথ্য এই ওয়েবসাইট এ সন্নিবেশিত থাকবে। আশাকরি ভবিষ্যতে এ ওয়েবসাইট টিকে সুষ্ঠুভাবে রক্ষানাবেক্ষন করা হবে এবং এর মাধ্যমে ঢাকা শিক্ষা বোর্ড সহ আগ্রহী সংশ্লিষ্ট সবাই প্রয়োজনীয় তথ্যাদি অবহিত হতে সক্ষম হবেন।</p>'),
(3, 'chairmanMsg', 'চেয়ারম্যানের বাণী', '<p><img src="assets/otherFiles/President163.jpg" alt="president" width="200" height="200" /></p>\r\n<p>আনন্দ নগর আদর্শ উচ্চ বিদ্যালয়ের বিস্তারিত তথ্য সম্বলিত একটি ওয়েবসাইটের সুচনা নিঃসন্দেহে একটি গুরুত্বপূর্ণ মাইল</p>\r\n<p><span style="color: #666666; font-family: Helvetica, Arial, sans-serif; font-size: 13px;">@@</span></p>\r\n<p>ফলক হিসেবে বিবেচিত। প্রতিষ্ঠানের সম্পদ, জনবল কাঠামো ভর্তিসহ বিভিন্ন পরীক্ষা, রুটিন, ছুটি ও বার্ষিক অনুষ্ঠান সুচীসহ বিভিন্ন গুরুতবপূর্ন তথ্য এই ওয়েবসাইট এ সন্নিবেশিত থাকবে। আশাকরি ভবিষ্যতে এ ওয়েবসাইট টিকে সুষ্ঠুভাবে রক্ষানাবেক্ষন করা হবে এবং এর মাধ্যমে ঢাকা শিক্ষা বোর্ড সহ আগ্রহী সংশ্লিষ্ট সবাই প্রয়োজনীয় তথ্যাদি অবহিত হতে সক্ষম হবেন।</p>'),
