(82, 'imnotice', 'আগামী ১ মে ২০১৭ইং তারিখ থেকে ১৩ মে ২০১৭ইং তারিখ পর্যন্ত স্কুল বন্ধ থাকিবে', 'আগামী ১ মে ২০১৭ইং তারিখ থেকে ১৩ মে ২০১৭ইং তারিখ পর্যন্ত {মে দিবস}, {পবিত্র সব-ই বরাত}, {গ্রীষ্মকালীন অবকাশ} ছুটির কারণে স্কুলের সকল কার্যক্রম বন্ধ থাকিবে। আগামী ১৪ মে ২০১৭ইং তারিখ থেকে যথারীতি স্কুলের কার্যক্রম চলবে।\r\n\r\nপ্রধান শিক্ষক,\r\nআনন্দ নগর আদর্শ উচ্চ বিদ্যালয়,\r\nবাড্ডা, ঢাকা।', 1, ''),
(86, 'notice', 'আগামী ১ মে ২০১৭ইং তারিখ থেকে ১৩ মে ২০১৭ইং তারিখ পর্যন্ত স্কুল বন্ধ থাকিবে', 'আগামী ১ মে ২০১৭ইং তারিখ থেকে ১৩ মে ২০১৭ইং তারিখ পর্যন্ত {মে দিবস}, {পবিত্র সব-ই বরাত}, {গ্রীষ্মকালীন অবকাশ} ছুটির কারণে স্কুলের সকল কার্যক্রম বন্ধ থাকিবে। আগামী ১৪ মে ২০১৭ইং তারিখ থেকে যথারীতি স্কুলের কার্যক্রম চলবে।\r\n\r\nপ্রধান শিক্ষক,\r\nআনন্দ নগর আদর্শ উচ্চ বিদ্যালয়,\r\nবাড্ডা, ঢাকা।', 1, ''),
(87, 'imnotice', '৩য় থেকে ১০ম শ্রেনীর ১ম সাময়িক পরীক্ষা আগামি ০৬/০৪/২০১৭ ইং তারিখ থেকে শুরু হবে', '২০১৭ শিক্ষাবর্ষের ৩য় থেকে ১০ম শ্রেনীর ১ম সাময়িক পরীক্ষা আগামি ০৬/০৪/২০১৭ ইং তারিখ থেকে আরম্ভ হবে। সকল শিক্ষার্থীদের পরীক্ষা শুরু হওয়ার পূর্বেই বেতন এবং পরীক্ষার ফিস প্রদান করে এডমিট কার্ড সংগ্রহ করার জন্য নির্দেশ দেয়া হল।\r\n\r\nপ্রধান শিক্ষক,\r\nআনন্দ নগর আদর্শ উচ্চ বিদ্যালয়,\r\nবাড্ডা, ঢাকা।', 1, ''),
